import React from "react";
import { NavLink } from "react-router-dom";
import Styles from "./NavBar.module.scss";
import Menu from "./Menu/Menu";
import uuid from "u"

const NavBar = (props) => {

    const navMenu = {
        reports: {
            title: "Reports",
            subMenu: [
                <NavLink to="/reports/sales">Sales<div className="spacer"></div></NavLink>
            ]
        },

    }

    return (
        <div className={Styles.wrapper}>
            <NavLink to="/inventory">Inventory</NavLink>
            <Menu id={uuid.v4()}{...navMenu.reports}/>
            <NavLink to="/inventory">Leave Feeback</NavLink>
        </div>
    );
}

export default NavBar;
